              contractKind: "contract",
              documentation:
                "@title EthRefund\n@dev The EthRefund contract is meant to serve as a transition area for funds between a sender\nand a recipient, where the sender can take the funds back if they cancel the transaction,\nand the recipient can only retrieve the funds in a specified amount of time, using\na code communicated privately by the sender.\n * The usage of the contract is as follows:\n * 1) The sender generates a passphrase, and passes sha256(code,recipient) to the\ncontract, along with a holding time. This registers a transaction ID (which must be unique), and\nmarks the start of the holding time window.\n2) The sender communicates this code to the recipient over a secure channel.\n3) Before the holding time has passed, the recipient can send the code to the contract to withdraw the funds.\n4) After the holding time has passed, the recipient is no longer able to withdraw the funds, regardless\nof whether they have the code or not.\n * At any time, the sender can cancel the transaction if they provide the transaction ID, which\nwill initiate a transfer of funds back to the sender.\nThe sender is expected to cancel the transaction if they have made a mistake in specifying\nthe recipient's address, the recipient does not claim the funds, or if the holding period has expired and the\nfunds need to be retrieved.\n * TODO: Currently, the transaction ID is a truncated version of the code hash that is used to ensure knowledge of the\npassphrase. They will be left as separate entities for now in case they need to be constructed differently.\n * NOTE: the hold time functionality is not very secure for small time periods since it uses now (block.timestamp). It is meant to be an additional security measure, and should not be relied upon in the case of an\nattack. The current known tolerance is 900 seconds:\nhttps://github.com/ethereum/wiki/blob/c02254611f218f43cbb07517ca8e5d00fd6d6d75/Block-Protocol-2.0.md\n * Some parts are modified from https://github.com/forkdelta/smart_contract/blob/master/contracts/ForkDelta.sol",
